import { useEffect, useContext } from "react";
import "../index.css";
import "../styles/SubmitData.css";
import { targetContext } from "./Midnight";

function SubmitData() {
  const { targetList, submitDataa, setSubmitData } = useContext(targetContext);
  useEffect(() => {
    handleLeaderboard();
  }, [targetList]);

  function handleLeaderboard() {
    if (targetList.length > 0 && targetList[0].status === true) {
      console.log("Target status is true.");
      setSubmitData(true);
    }
  }
  return <div className="submit-container"></div>;
}

export default SubmitData;
